// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract UniversityManagement {
    struct University {
        string name;
        string location;
        bool isAccredited;
    }

    struct Staff {
        address wallet;
        string ipfsHash;
        string docHash;
        string employeeID;
    }

    struct Student {
        address wallet;
        string ipfsHash;
        string docHash;
        string rollNo;
    }

    struct Log {
        address victim;
        address modifiedBy;
        string ipfsHash;
        uint256 timestamp;
    }

    University public university;
    mapping(address => Staff) public staffs;
    mapping(address => Student) public students;
    mapping(string => address) private staffByEmployeeID;
    mapping(string => address) private studentByRollNo;
    address public admin;

    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin can perform this action");
        _;
    }

    modifier onlySelfOrAdmin(address wallet) {
        require(
            msg.sender == admin || msg.sender == wallet,
            "Only admin or the owner of this data can perform this action"
        );
        _;
    }

    constructor(string memory uniName, string memory uniLocation, bool accredited) {
        admin = msg.sender;
        university = University(uniName, uniLocation, accredited);
        
    }

    function updateUniversity(string memory name, string memory location, bool accredited) public onlyAdmin {
        university.name = name;
        university.location = location;
        university.isAccredited = accredited;
        
    }

    function addStaff(
        address wallet,
        string memory ipfsHash,
        string memory docHash,
        string memory employeeID
    ) public onlyAdmin {
        require(bytes(staffs[wallet].ipfsHash).length == 0, "Staff already exists.");
        require(staffByEmployeeID[employeeID] == address(0), "Employee ID already in use.");
        staffs[wallet] = Staff(wallet, ipfsHash, docHash, employeeID);
        staffByEmployeeID[employeeID] = wallet;
        
    }

    function addStudent(
        address wallet,
        string memory ipfsHash,
        string memory docHash,
        string memory rollNo
    ) public onlyAdmin {
        require(bytes(students[wallet].ipfsHash).length == 0, "Student already exists.");
        require(studentByRollNo[rollNo] == address(0), "Roll number already in use.");
        students[wallet] = Student(wallet, ipfsHash, docHash, rollNo);
        studentByRollNo[rollNo] = wallet;
    }

    function getStaffByEmployeeID(string memory employeeID) public view onlyAdmin returns (Staff memory) {
        address staffAddress = staffByEmployeeID[employeeID];
        require(staffAddress != address(0), "Staff not found");
        return staffs[staffAddress];
    }

    function getStudentByRollNo(string memory rollNo) public view onlyAdmin returns (Student memory) {
        address studentAddress = studentByRollNo[rollNo];
        require(studentAddress != address(0), "Student not found");
        return students[studentAddress];
    }
       function updateStaff(
        address target,
        string memory ipfsHash,
        string memory docHash,
        string memory employeeID
    ) public {
        if (msg.sender == admin) {
            Staff storage staff = staffs[target];
            require(bytes(staff.ipfsHash).length > 0, "Staff does not exist.");
            staff.ipfsHash = ipfsHash;
            staff.docHash = docHash;
            staff.employeeID = employeeID;
        } else {
            require(msg.sender == target, "Only self can edit this data.");
            Staff storage staff = staffs[msg.sender];
            staff.ipfsHash = ipfsHash;
            staff.employeeID = employeeID;
        }
    }

    function updateStudent(
        address target,
        string memory ipfsHash,
        string memory docHash,
        string memory rollNo
    ) public {
        if (msg.sender == admin) {
            Student storage student = students[target];
            require(bytes(student.ipfsHash).length > 0, "Student does not exist.");
            student.ipfsHash = ipfsHash;
            student.docHash = docHash;
            student.rollNo = rollNo;
        } else {
            require(msg.sender == target, "Only self can edit this data.");
            Student storage student = students[msg.sender];
            student.ipfsHash = ipfsHash;
            student.rollNo = rollNo;
        }
    }

     function getStaff(address wallet) public view onlySelfOrAdmin(wallet) returns (Staff memory) {
        return staffs[wallet];
    }

    function getStudent(address wallet) public view onlySelfOrAdmin(wallet) returns (Student memory) {
        return students[wallet];
    }

    function isAdmin(address wallet) public view returns (bool) {
        return wallet == admin;
    }

    function isStaff(address wallet) public view returns (bool) {
        return bytes(staffs[wallet].ipfsHash).length > 0;
    }

    function isStudent(address wallet) public view returns (bool) {
        return bytes(students[wallet].ipfsHash).length > 0;
    }

    

    mapping(address => Log[]) public userLogs;

   

    

    function addLog(address victim, string memory ipfsHash) public onlySelfOrAdmin(victim) {
        Log memory newLog = Log(victim, msg.sender, ipfsHash, block.timestamp);
        userLogs[victim].push(newLog);

        if (userLogs[victim].length > 10) {
            for (uint256 i = 1; i < userLogs[victim].length; i++) {
                userLogs[victim][i - 1] = userLogs[victim][i];
            }
            userLogs[victim].pop();
        }
    }

    function getLogs(address victimAddress) public view returns (Log[] memory) {
        return userLogs[victimAddress];
    }
}
